import React from 'react';
import { useNavigate } from 'react-router-dom';

function HeaderAdd(props) {

    const navigate = useNavigate()
    
    function goToAdd(){
        navigate("new-user");
    }

    return ( 
       <header className='my-header-add'>
            <img className="back" src="icons/back.png" alt="back"/>
            <h1>NOUVEAU UTILISATEUR</h1>
       </header>
     );
}

export default HeaderAdd;
